var title_f31_10_31916="Definition of BPD";
var content_f31_10_31916=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F64789&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F64789&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Definition of bronchopulmonary dysplasia: Diagnostic criteria",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"1\" rowspan=\"2\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\" rowspan=\"1\">",
"        Gestational age",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        &lt;32 week",
"       </td>",
"       <td class=\"subtitle2\">",
"        &ge;32 week",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Time point of assessment",
"       </td>",
"       <td>",
"        36 weeks PMA or discharge to home, whichever comes first",
"       </td>",
"       <td>",
"        &gt;28 days but &lt;56 days postnatal age or discharge to home, whichever comes first",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle2_left\" colspan=\"2\" rowspan=\"1\">",
"        Treatment with oxygen &gt;21 percent for at least 28 days plus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mild BPD",
"       </td>",
"       <td>",
"        Breathing room air at 36 weeks PMA or discharge, whichever comes first",
"       </td>",
"       <td>",
"        Breathing room air by 56 days postnatal age or discharge, whichever comes first",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Moderate BPD",
"       </td>",
"       <td>",
"        Need* for &lt;30 percent oxygen at 36 weeks PMA or discharge, whichever comes first",
"       </td>",
"       <td>",
"        Need* for &lt;30 percent oxygen at 56 days postnatal age or discharge, whichever comes first",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Severe BPD",
"       </td>",
"       <td>",
"        Need* for &ge;30 percent oxygen and/or positive pressure (PPV or NCPAP) at 36 weeks PMA or discharge, whichever comes first",
"       </td>",
"       <td>",
"        Need* for &ge;30 percent oxygen and/or positive pressure (PPV",
"or NCPAP) at 56 days postnatal age or discharge, whichever comes first",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     BPD: bronchopulmonary dysplasia; NCPAP: nasal continuous positive airway pressure; PMA: postmenstrual age; PPV: positive-pressure ventilation.",
"     <br>",
"      * A physiologic test confirming that the oxygen requirement at the assessment time point remains to be defined. This assessment may include a pulse oximetry saturation range.",
"      <br>",
"       BPD usually develops in neonates being treated with oxygen and positive pressure ventilation for respiratory failure, most commonly respiratory distress syndrome. Persistence of clinical features of respiratory disease (tachypnea, retractions, rales) are considered common to the broad description of BPD and have not been included in the diagnostic criteria describing the severity of BPD. Infants treated with oxygen &gt;21 percent and/or positive pressure for nonrespiratory disease (eg, central apnea or diaphragmatic paralysis) do not have BPD unless they also develop parenchymal lung disease and exhibit clinical features of respiratory distress. A day of treatment with oxygen &gt;21 percent means that the infant received oxygen &gt;21 percent for more than 12 hours on that day. Treatment with oxygen &gt;21 percent and/or positive pressure at 36 weeks PMA, or at 56 days postnatal age or discharge, should not reflect an \"acute\" event, but should rather reflect the infant's usual daily therapy for several days preceding and following 36 weeks PMA, 56 days postnatal age, or discharge.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Jobe AH, Bancalari E. Bronchopulmonary dysplasia. Am J Respir Crit Care Med 2001; 163:1723. Copyright &copy;2001 American Thoracic Society.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f31_10_31916=[""].join("\n");
var outline_f31_10_31916=null;
var title_f31_10_31917="Antimicrobial regimens sinusitis children";
var content_f31_10_31917=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F83454&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F83454&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antimicrobial regimens for acute bacterial rhinosinusitis in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"33%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Indication",
"       </td>",
"       <td class=\"subtitle1\">",
"        Initial therapy",
"       </td>",
"       <td class=\"subtitle1\">",
"        Second line therapy(s)*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Outpatient therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mild/moderate disease",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Preferred:",
"         </strong>",
"         Amoxicillin-clavulanate 45 mg/kg",
"         <sup>",
"          &Delta;",
"         </sup>",
"         per day orally divided in 2 doses (maximum 1.75 g/day)",
"        </p>",
"        <strong>",
"         Alternative",
"        </strong>",
"        <sup>",
"         &loz;",
"        </sup>",
"        <strong>",
"         :",
"        </strong>",
"        Amoxicillin 90 mg/kg per day orally divided in 2 doses",
"       </td>",
"       <td>",
"        Amoxicillin-clavulanate 90 mg/kg",
"        <sup>",
"         &sect;",
"        </sup>",
"        per day orally divided in 2 doses (maximum 4 g/day)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"indent1\">",
"        Severe disease or risk for antibiotic resistance",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Preferred:",
"         </strong>",
"         Amoxicillin-clavulanate 90 mg/kg",
"         <sup>",
"          &sect;",
"         </sup>",
"         per day orally divided in 2 doses (maximum 4 g/day)",
"        </p>",
"        <p>",
"         <strong>",
"          Alternatives",
"         </strong>",
"         <sup>",
"          &loz;",
"         </sup>",
"         <strong>",
"          :",
"         </strong>",
"         Cefpodoxime 10 mg/kg per day orally divided in 2 doses (maximum 400 mg/day), or",
"        </p>",
"        <p>",
"         Cefdinir 14 mg/kg per day orally divided in 1 or 2 doses (maximum 600 mg/day), or",
"        </p>",
"        Levofloxacin",
"        <sup>",
"         &yen;",
"        </sup>",
"        10 to 20 mg/kg per day orally divided in 1 or 2 doses (maximum 500 mg/day)",
"       </td>",
"       <td>",
"        <p>",
"         Ceftriaxone 50 mg/kg once per day (maximum 2g/day) for 1 to 3 days followed by appropriate oral regimen, or",
"        </p>",
"        <p>",
"         Cefpodoxime 10 mg/kg per day orally divided in 2 doses (maximum 400 mg/day), or",
"        </p>",
"        <p>",
"         Cefdinir 14 mg/kg per day orally divided in 1 or 2 doses (maximum 600 mg/day), or",
"        </p>",
"        Levofloxacin",
"        <sup>",
"         &yen;",
"        </sup>",
"        10 to 20 mg/kg per day orally divided in 1 or 2 doses (maximum 500 mg/day)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"indent1\">",
"        Penicillin allergy (anaphylaxis)",
"       </td>",
"       <td>",
"        Levofloxacin",
"        <sup>",
"         &yen;",
"        </sup>",
"        10 to 20 mg/kg per day orally divided in 1 or 2 doses (maximum 500 mg/day)",
"       </td>",
"       <td>",
"        Inpatient therapy (see below)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"indent1\">",
"        Penicillin allergy (non-anaphylaxis)",
"       </td>",
"       <td>",
"        <p>",
"         Cefpodoxime 10 mg/kg per day orally divided in 2 doses (maximum 400 mg/day), or",
"        </p>",
"        Cefdinir 14 mg/kg per day orally divided in 1 or 2 doses (maximum 600 mg/day)",
"       </td>",
"       <td>",
"        Levofloxacin",
"        <sup>",
"         &yen;",
"        </sup>",
"        10 to 20 mg/kg per day orally divided in 1 or 2 doses (maximum 500 mg/day)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"indent1\">",
"        Vomiting",
"       </td>",
"       <td>",
"        One dose of ceftriaxone 50 mg/kg per day IV or IM (maximum 2 g/day), followed 24 hours later by appropriate oral therapy",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Inpatient therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        ABRS requiring hospitalization",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        <p>",
"         Ampicillin-sulbactam 200 to 400 mg/kg per day IV divided every 6 hours (maximum 8 g ampicillin component/day), or",
"        </p>",
"        <p>",
"         Ceftriaxone 50 mg/kg per day IV divided every 12 hours (maximum 2 g/day), or",
"        </p>",
"        <p>",
"         Cefotaxime 100 to 200 mg/kg per day IV divided every 6 hours (maximum 8 g/day), or",
"        </p>",
"        Levofloxacin",
"        <sup>",
"         &yen;",
"        </sup>",
"        10 to 20 mg/kg per day IV divided every 12 or 24 hours (maximum 500 mg/day)",
"       </td>",
"       <td>",
"        <p>",
"         Addition of vancomycin (60 mg/kg per day IV) divided every 6 hours (maximum 4 g/day) and possibly,",
"        </p>",
"        Metronidazole (30 mg/kg per day IV) divided every 6 hours (maximum 4 g/day)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IV: intravenously; IM: intramuscularly; ABRS: acute bacterial rhinosinusitis.",
"     <br>",
"      * Second-line therapies are indicated for children who worsen within three days or fail to improve after three to five days of initial therapy and in whom no pathogen is identified. If a pathogen is identified, antimicrobial therapy should be adjusted according to susceptibilities.",
"      <br>",
"       &bull; See text for definitions.",
"       <br>",
"        ��������� Based on amoxicillin component; use 200 or 400 mg/5 mL suspension or 200 or 400 mg chewable tablet for appropriate clavulanate ratio.",
"        <br>",
"         &loz; Alternative regimens may not cover resistant pathogens as well as the suggested initial regimen.",
"         <br>",
"          &sect; Based on amoxicillin component; use 600/5 mL suspension or 1000 mg/62.5 mg tablet for appropriate clavulanate ratio.",
"          <br>",
"           &yen; Levofloxacin should be reserved for cases in which there is no other safe and effective alternative.",
"           <br/>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     References",
"     <br>",
"      <ol>",
"       <li>",
"        Chow AW, Benninger MS, Brook I, et al. IDSA Clinical Practice Guideline for Acute Bacterial Rhinosinusitis in Children and Adults. Clin Infect Dis 2012; 54:e72.",
"       </li>",
"       <li>",
"        Bradley JS, Jackson MA, Committee on Infectious Diseases, American Academy of Pediatrics. The use of systemic and topical fluoroquinolones. Pediatrics 2011; 128:e1034.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
